import { StyleSheet} from 'react-native';
import * as Colors from "../../const/colors";
const notFoundPageStyles = StyleSheet.create({
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  link: {
    marginTop: 15,
    paddingVertical: 15,
  },
  linkText: {
    fontSize: 14,
    color: Colors.darkerblue,
  },
  icon:{
    fontSize:30,
  },
});
export {notFoundPageStyles};
